import React from "react";
import ReactBootstrap from "react-bootstrap";
import ReactDOM from "react-dom";
import { BrowserRouter as Router, Route, HashRouter} from "react-router-dom";
import './index.css';
import 'bootstrap/dist/css/bootstrap.min.css';
import Table1 from "./components/Table1";
import Login from "./components/Login";
import Registration from "./components/Registration";
import MainMenu from "./components/MainMenu";
import CustomPCCPU from "./components/CustomPCCPU";
import BudgetPC from "./components/BudgetPC";
import GPU from "./components/GPU";
import RAM from "./components/RAM";
import Storages from "./components/Storages";
import Motherboard from "./components/Motherboard";
import PSU from "./components/PSU";
import TotalPrice from "./components/TotalPrice";
import PCConfigurations from "./components/PCConfigurations";

class RouterNavigationSample extends React.Component {
  render() {
    return (
      <Router>
      <div className="container">
        <>
          <Route
            exact
            path="/"
            render={props => <Login {...props} />}/>

          <Route path="/Table1" render={props => <Table1 {...props} />}/>
          <Route path="/registration" render={props => <Registration {...props}/>}/>
          <Route path="/home" render={props => <MainMenu {...props}/>}/>
          <Route path="/custompccpu" render={props => <CustomPCCPU {...props}/>}/>
          <Route path="/budgetpc" render={props => <BudgetPC {...props}/>}/>
          <Route path="/gpu" render={props => <GPU {...props}/>}/>
          <Route path="/ram" render={props => <RAM {...props}/>}/>
          <Route path="/storage" render={props => <Storages {...props}/>}/>
          <Route path="/motherboard" render={props => <Motherboard {...props}/>}/>
          <Route path="/psu" render={props => <PSU {...props}/>}/>
          <Route path="/totalprice" render={props => <TotalPrice {...props}/>}/>
          <Route path="/pcconfigurations" render={props => <PCConfigurations {...props}/>}/>
        </>
        </div>
      </Router>
    );
  }
}

const rootElement = document.getElementById("root");
ReactDOM.render(<RouterNavigationSample />, rootElement);
